app.directive("queryFace", function() {
	return {
		restrict: "E",
		templateUrl: "../libs/views/queryFace.html",
		scope: {
			result: "&",
			prev: "&",
			next: "&"
		},
		controller: function($scope, $location, $rootScope, $interval, $timeout) {
			//$scope.capturePhoto = "";
			$scope.capturePhoto = "";
			var idCard = "";
			var name = "";
			var img = "";
			$scope.idCardList = [{
					"idcard": "310228198808070818",
					"name": "陈雷",
					"img":""
				},
				{
					"idcard": "350722199011260084",
					"name": "毛雅璐",
					"img": ""
				},
				{
					"idcard": "410901197704194047",
					"name": "闫艳丽",
					"img":"data:image/jpeg;base64,"
				},
				{
					"idcard": "310105198006031219",
					"name": "贝聿运",
					"img":""
				},
				{
					"idcard": "310102197609274814",
					"name": "陈祺",
					"img":""
				},
				{
					"idcard": "310108198906260542",
					"name": "魏洁璐",
					"img":""
				}
			]
			//初始化摄像头
			$.device.Camera_Init(640, 480, 640, 340); //初始化摄像头
			var camera = window.external.GetConfig('camera');
			var index = window.external.GetConfig('resolution') || 1;
			$.device.Camera_Link(camera, index); //初始化摄像头
			$.device.Camera_Show();
			$scope.$on("$destroy", function() {
				$.device.Camera_Hide();
			});
			$scope.$watch('$viewContentLoaded', function() {  
    			  $scope.show = false;
    			  $scope.isLoding = true;
			}); 
			$scope.idcard = "";
			$scope.keybordArr = [1, 2, 3, 4, 5, 6, 7, 8, 9, 'X', 0, '删除'];
			$scope.keyboardInput = function(e) { //键盘输入
				var keycode = window.event ? e.keyCode : e.which;
				if(keycode >= 48 && keycode <= 57) {} else if(keycode == 8) {} else {
					$scope.idcard = $scope.idcard.substring(0, $scope.idcard.length - 1);
				}
			}
			$scope.inputNumber = function(item) { //软键盘输入
				if($scope.idcard === "请输入身份证号码后6位") {
					return;
				}
				if(item === '重输') {
					$scope.idcard = "";
				} else if(item === '删除') {
					$scope.idcard = $scope.idcard.substring(0, $scope.idcard.length - 1);
				} else{
					$scope.idcard += item;
				}
			}
			$scope.capture = function() { //拍照
				$scope.capturePhoto = $.device.Camera_Base64();
				$.device.Camera_Hide();
				$scope.show = true;
				 document.getElementById('pt').style.visibility = "";
			  document.getElementById('view-search').style.visibility = "";
			  document.getElementById('keybord').style.visibility = "";
				$timeout(function(){
					console.log(document.getElementById('input'));
					document.getElementById('input').focus();
					document.getElementById('input').select();
				},1000);
			};
			
			$scope.reRecognition = function() {
				$.device.Camera_Show();
				$scope.recognitionOver = false;
				$scope.show = false;
				$scope.img = true;
				document.getElementById('pt').style.visibility = "hidden";
			  document.getElementById('view-search').style.visibility = "hidden";
			  document.getElementById('keybord').style.visibility = "hidden";
			};
			$scope.success = function() {
				if($scope.tipsText === "核验通过") {
					$scope.result({
						idCard: idCard,
						Name: name,
					});
					$scope.next();
				} else {
					$location.path("/select");
				}

			}
			$scope.__prev = function() {
				$scope.prev();
			}
			$scope.__next = function() {
				$scope.show = false;
				document.getElementById('pt').style.visibility = "hidden";
			  document.getElementById('view-search').style.visibility = "hidden";
			  document.getElementById('keybord').style.visibility = "hidden";
				$scope.showImage = "";
//				$scope.tipsText = "核验中...";
//				$scope.showImage = "../libs/common/images/recognition.png";
				//$('img').css('margin-left','770px');
				$scope.isLoding = false;
				$scope.img = true;
				$scope.recognitionOver = false;
				$scope.getFace = function(face) { //获取数据
					for(var i = 0; i<$scope.idCardList.length; i++) {
						var str = ($scope.idCardList[i].idcard).substring(12,18);
						console.log(str);
						console.log($scope.idcard);
						if($scope.idcard === str) {
							idCard = $scope.idCardList[i].idcard;
							name = $scope.idCardList[i].name;
							img = $scope.idCardList[i].img;
						}
					}
					//核验
					$scope.recognition = function(face, photograph, idcard, name) { //人证数据对比
						var idCardPhoto = face
						var capturePhoto = photograph;
						$.ajax({
							url: "http://hengshui.5uban.com/ac-product-ext/ext/aci/autoterminal/facecompare.do",
							type: "post",
							dataType: "json",
							data: {
								idCardPhoto: idCardPhoto,
								capturePhoto: capturePhoto
							},
							success: function(res) {
								var n = res.similarity;
								$scope.recognitionOver = true;
								$scope.isLoding = true;
								$.log.debug(JSON.stringify(res));
								if(n > 60) {
									$scope.img = false;
									$scope.showImage = "../libs/common/images/success.png";
									$scope.tipsText ="核验通过";
								} else {
									//人证不符
									$scope.img = false;
									$scope.showImage = "../libs/common/images/failed.png";
									//$('img').css('margin-left','540px');
									$scope.tipsText = "未检索到人脸";
								}
							},
							error: function(err) {
								$scope.isLoding = true;
								$scope.img = false;
								$scope.showImage = "../libs/common/images/failed.png";
								//$('img').css('margin-left','540px');
								$scope.tipsText = "核验失败";
							}
						})
					};
					$scope.recognition(face, img, idCard, name);
				};
				$scope.getFace($scope.capturePhoto);
			}
		}
	}
});
